    <div className="App">
    <BrowserRouter>
    <Navbar/> 
    {/* // it needs to be inside the router as its path related. */}
    <div className="pages">
    <Routes>
      <Route path="/" element={ <Home/> }/>
    </Routes>
    </div>
    </BrowserRouter>
  </div>
  );
}

export default App;
